import './App.css';

function Nav() {
  return (
    <nav>
        <h3>Logo</h3>
            <ul className="nav-Links">
                <li>Home</li>
                <li>About</li>
                <li>Itinerary</li>
            </ul>
    </nav>
  );
}

export default Nav;
